import logo from './logo.svg';
import './App.css';
import {
    BrowserRouter,
    Routes,
    Route
} from "react-router-dom";
// src/pages/index.js를 통해서 한번에 import 할 수 있도록 함
import Login from './components/page/login/LoginPage'
import Register from './components/page/register/RegisterPage'
import Main from './components/page/main/MainPage'

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/login" element={<Login/>}/>
                <Route path="/register" element={<Register/>}/>
                <Route path="/main" element={<Main/>}/>
                {/*<Route exact path="/info" render={() => <Info userInfo={userInfo} />} />*/}
            </Routes>
        </BrowserRouter>
    );
}

export default App;
